    [Parameter] public string CurrentId { get; set; }
    Individual _objMain = new Individual();
    private List<Country> _countryList;
    private List<Gender> _genderList;
    protected override void OnInitialized()
    {
        _objMain = MainController.GetById_FirstOrDefault(Convert.ToInt32(CurrentId));
        _genderList =  GenderController.Get();
        _countryList =  CountryController.Get();
    }

    private void GoToCollection(string pLinkAddress,string pIdOfRecord)
    { 
      NavManager.NavigateTo(pLinkAddress+pIdOfRecord); // change "0" to the Contact Id in Individual Table
    }

    private void GoToCollection(string pLinkAddress,string pIdOfRecord,  string pChoosedEntityName, 
                               int pChoosedEntityId, string pChoosedEntityFK)
    {           
        NavManager.NavigateTo(pLinkAddress+"0");
 
        AppData.ChoosedEntityName=pChoosedEntityName; 
        AppData.ChoosedEntityId=pChoosedEntityId; 
        AppData.ChoosedEntityFK=pChoosedEntityFK;
     
    }

    protected void Save()
    {
        MainController.Update(_objMain);
        NavManager.NavigateTo("/IndOrg/Individual/ViewStd/"+CurrentId);
    }
       void Cancel()
    {
          NavManager.NavigateTo("/IndOrg/Individual/ViewStd/"+CurrentId);
    }

    

  

